import React from 'react';

function getCurrentDateTime() {
    let nowDate = new Date()
    let getNowDate = nowDate.getDate();
    let getNowMonth = nowDate.getMonth();
    let getNowYear = nowDate.getFullYear();
    let getNowHours = nowDate.getHours();
    let getNowMinutes = nowDate.getMinutes();
    let getNowSeconds = nowDate.getSeconds();
    let slash = '/';
    let separator = ' ';
    let colon = ':';

    return `${getNowDate<10?`0${getNowDate}`:`${getNowDate}`}${slash}
            ${getNowMonth<10?`0${getNowMonth}`:`${getNowMonth}`}${slash}
            ${getNowYear}
            ${separator}
            ${getNowHours<10?`0${getNowHours}`:`${getNowHours}`}${colon}
            ${getNowMinutes<10?`0${getNowMinutes}`:`${getNowMinutes}`}${colon}
            ${getNowSeconds<10?`0${getNowSeconds}`:`${getNowSeconds}`}${colon}`
}

export default getCurrentDateTime;
